        private static int GetIndexFractionP(double p, int indexS, out double fraction, double[][] pSide)
        {
            int index = 0;
            for (; (index < pSide[indexS].Length - 1) && (p >= pSide[indexS][index + 1]); index++) ;

            if ((index < pSide[indexS].Length - 2) && (p > pSide[indexS][index]))
            {
                fraction = (pSide[indexS][index + 1] - p) / (pSide[indexS][index + 1] - pSide[indexS][index]);
            }
            else
            {
                fraction = 0.0;
            }
            return index;
        }

        private static int GetIndexFractionN(int n, out double fraction, int min, int max)
        {
            fraction = 0;
            if (n <= min) return 0;
            if (n <= 30)
            {
                return n - 1;
            }
            return max - 1;
        }

        public static double GetDistribution(int index1, double fraction1, int index2, double fraction2, double[][] data)
        {
            var result = data[index1][index2];
            if (fraction2 > 0)
                result += fraction2 * (data[index1][index2 + 1] - data[index1][index2]);
            return result;
        }
